"use strict";

$(function () {
  $("#topics").change(function () {
    var o = $("option:selected").attr("value");
    console.log(o);
    var t = "https://api.nytimes.com/svc/topstories/v2/" + o + ".json";
    t += "?" + $.param({
      "api-key": "14bcc5d04435458ba00c5d1853898e15"
    }), $.ajax({
      url: t,
      method: "GET"
    }).done(function (o) {
      console.log(o);
    }).fail(function (o) {
      throw o;
    });
  });
});